content:
create_custom_element(
	Component,
	{
		title: {
			attribute: 'title',
			reflect: true,
			type: 'String'
		},
		count: {
			attribute: 'count',
			reflect: true,
			type: 'Number'
		},
		enabled: {
			attribute: 'enabled',
			reflect: true,
			type: 'Boolean'
		}
	},
	[],
	[],
	true
);

const tagName = "simple-component";
if (!customElements.get(tagName) && Component.element !== undefined) {
    customElements.define(tagName, Component.element);
}
